import { HashRouter as Router, Switch, Route } from 'react-router-dom'

function App() {
  return (
    <Router>
      <ScrollToTop>
        <Switch>
          <Route exact path="/" component={MainPage} />
          </Switch>
      </ScrollToTop>
    </Router>
  );
}

export default App;
